import React from 'react';

const YourBotArmy = ({ enlistedBots = [], onDelete }) => {
  const handleDelete = (botId) => {
    onDelete(botId);
  };

  return (
    <div className="your-bot-army">
      <h3>Your Bot Army</h3>
      {enlistedBots.length === 0 ? (
        <p>Your bot army is empty.</p>
      ) : (
        enlistedBots.map((bot) => (
          <div key={bot.id} className="bot-card">
            {/* ...Other bot information... */}
            <button onClick={() => handleDelete(bot.id)}>delete</button>
            <button onClick={()=>handleEnlist(bot.id)}>Enli</button>
          </div>
        ))
      )}
    </div>
  );
};

export default YourBotArmy;
